```typescript
import { Injectable } from '@nestjs/common';
import { NestFactory, Req, Res } from '@nestjs/core';
import { NestMiddleware, UnauthorizedException } from '@nestjs/core';
import { AppController } from './app.controller';
import { AppService } from './app.service';
import { Logger } from 'winston';

const IS_PRODUCTION = process.env.NODE_ENV === 'production';

@Injectable()
class ProductionGuard implements NestMiddleware {
  constructor(private logger: Logger) {}

  use(req: any, res: any, next: () => any) {
    if (!IS_PRODUCTION) {
      this.logger.warn('Access denied in development mode');
      throw new UnauthorizedException();
    }

    next();
  }
}

@NestFactory()
export class AppFactory extends NestFactory {
  private productionGuard: ProductionGuard;

  constructor(@Inject('WINSTON') private readonly logger: Logger) {
    super();

    this.productionGuard = new ProductionGuard(this.logger);
  }

  create(options?: any): any {
    const app = super.create(options);

    // Apply middleware to all requests
    app.use(this.productionGuard);

    // Mount controllers
    app.mount('/', new AppController(new AppService()));

    return app;
  }
}
```

