public class NaiveBayesModel
{
    private Dictionary<string, double[]> categoryProbs;

    public NaiveBayesModel(Dictionary<string, double[]> categoryProbs)
    {
        this.categoryProbs = categoryProbs;
    }

    public string Predict(WordCounts wordCounts)
    {
        double maxProb = double.MinValue;
        string maxCategory = null;

        foreach (var category in categoryProbs.Keys)
        {
            var prob = CalculateProbability(wordCounts, categoryProbs[category]);
            if (prob > maxProb)
            {
                maxProb = prob;
                maxCategory = category;
            }
        }

        return maxCategory;
    }

    private double CalculateProbability(WordCounts wordCounts, double[] categoryProbs)
    {
        double denominator = 1.0;
        double numerator = 1.0;

        foreach (int i = 0; i < categoryProbs.Length; i++)
        {
            var count = Math.Max(wordCounts.Counts[i], 1); // Smooth zero-frequency words
            denominator *= categoryProbs[i];
            numerator *= Math.Pow(count / wordCounts.Text.Split(' ').Length, wordCounts.Counts[i]);
        }

        return numerator / denominator;
    }
}

