```jsx
const generateRandomPlanets = (numPlanets, minDistance) => {
  const planets = [];
  let attempts = 0;

  while (planets.length < numPlanets && attempts < 100) {
    attempts++;

    let tooClose = false;

    for (let I = 0; I < planets.length; i++) {
      const otherPlanet = planets[i];
      const distance = Math.sqrt(
        Math.pow(otherPlanet.position[0] - planet.position[0], 2) +
          Math.pow(otherPlanet.position[1] - planet.position[1], 2) +
          Math.pow(otherPlanet.position[2] - planet.position[2], 2)
      );

      if (distance < minDistance) {
        tooClose = true;
        break;
      }
    }

    if (!tooClose) {
      const planet = {
        position: [
          randomPosition(-30, 30),
          randomPosition(-30, 30),
          randomPosition(-30, 30),
        ],
        size: randomSize(1, 5) * scale,
        color: randomColor(),
        ringSize: 0.2 * scale,
        ringColor: randomColor(),
        ringNoise: 0.3 * scale,
      };

      planets.push(planet);
    }
  }

  return planets;
};
```

In this version, we keep track of whether any existing planet is too close using a boolean flag called `tooClose`. If any such planet is found, we exit the inner loop and move on to the next iteration of the outer loop. This ensures that each new planet is sufficiently far away from all existing ones. You can adjust the value of `minDistance` to control how closely packed the planets should be. A smaller value will result in more crowded systems, while a larger value will give more spacious environments. Feel free to experiment

